import React from "react";
import { Button, ButtonGroup } from "reactstrap";

const Linksr2 = props => {
  return (
    <ButtonGroup size="lg">
      <Button>TeleMedicine</Button>
      <Button>Contact Us</Button>
    </ButtonGroup>
  );
};

export default Linksr2;
